byte*res_get(const char*nm,dword*size)
{
 int i;
#ifdef resonfile
 if(res_bin==NULL)
 {
  FILE*res=fopen("resource.bin","rb");
  if(res){
   res_bin=(byte*)malloc(res_binsize);
   fread(res_bin,1,res_binsize,res);
   fclose(res);}
 }
#endif
 for(i=0;*res_names[i];i++)
  if(strcmp(res_names[i],nm)==0)
  {
   if(size) *size=res_pos[i+1]-res_pos[i];
   return &res_bin[res_pos[i]];
  }
 return NULL;
}
int res_getvalue(const char*nm,int defvalue)
{
 byte*data=res_get(nm,NULL);
 if(data&&(data[0]==0))
  return *(int*)&data[1];
 else
  return defvalue;
}
const char*res_getstring(const char*nm,const char*defvalue)
{
 byte*data=res_get(nm,NULL);
 if(data&&(data[0]==1))
  return (const char*)&data[1];
 else
  return defvalue;
}
